import React, { useState, useContext } from 'react';
import { InventoryContext } from '../context/InventoryContext';

const ProductManagement = () => {
  const { products, addProduct, updateProduct, deleteProduct } = useContext(InventoryContext);
  const [newProduct, setNewProduct] = useState({
    id: '',
    name: '',
    description: '',
    category: '',
    price: 0,
    quantity: 0
  });
  const [isEditing, setIsEditing] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setNewProduct({ ...newProduct, [name]: value });
  };

  const handleAddProduct = () => {
    addProduct({ ...newProduct, id: Date.now() });
    setNewProduct({ id: '', name: '', description: '', category: '', price: 0, quantity: 0 });
  };

  const handleUpdateProduct = () => {
    updateProduct(newProduct);
    setNewProduct({ id: '', name: '', description: '', category: '', price: 0, quantity: 0 });
    setIsEditing(false);
  };

  const handleEditProduct = (product) => {
    setNewProduct(product);
    setIsEditing(true);
  };

  const handleDeleteProduct = (productId) => {
    deleteProduct(productId);
  };

  return (
    <div>
      <h2>Product Management</h2>
      <div style={{ display: 'flex', flexDirection: 'column', gap: '10px', maxWidth: '400px' }}>
        <input
          type="text"
          name="name"
          placeholder="Product Name"
          value={newProduct.name}
          onChange={handleChange}
          style={{ width: '100%', height: '30px' }}
        />
        <input
          type="text"
          name="description"
          placeholder="Description"
          value={newProduct.description}
          onChange={handleChange}
          style={{ width: '100%', height: '30px' }}
        />
        <input
          type="text"
          name="category"
          placeholder="Category"
          value={newProduct.category}
          onChange={handleChange}
          style={{ width: '100%', height: '30px' }}
        />
        <input
          type="number"
          name="price"
          placeholder="Price"
          value={newProduct.price}
          onChange={handleChange}
          style={{ width: '100%', height: '30px' }}
        />
        <input
          type="number"
          name="quantity"
          placeholder="Initial Quantity"
          value={newProduct.quantity}
          onChange={handleChange}
          style={{ width: '100%', height: '30px' }}
        />
        <button onClick={isEditing ? handleUpdateProduct : handleAddProduct} style={{ height: '35px' }}>
          {isEditing ? 'Update Product' : 'Add Product'}
        </button>
      </div>

      <table border="1" style={{ width: '100%', marginTop: '20px' }}>
        <thead>
          <tr>
            <th>Product Name</th>
            <th>Description</th>
            <th>Category</th>
            <th>Price</th>
            <th>Initial Quantity</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {products.map((product) => (
            <tr key={product.id}>
              <td>{product.name}</td>
              <td>{product.description}</td>
              <td>{product.category}</td>
              <td>{product.price}</td>
              <td>{product.quantity}</td>
              <td>
                <button onClick={() => handleEditProduct(product)} style={{ marginRight: '5px' }}>Edit</button>
                <button onClick={() => handleDeleteProduct(product.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ProductManagement;
